import { useEffect, useState } from 'react';

export default function DoctorDashboard() {
  const [patients, setPatients] = useState([]);
  const [editingId, setEditingId] = useState(null);
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [disease, setDisease] = useState('');
  const token = localStorage.getItem('token');

  useEffect(() => {
    fetch('http://localhost:8080/api/patients', {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => setPatients(data));
  }, []);

  const handleEdit = (patient) => {
    setEditingId(patient.id);
    setName(patient.name);
    setAge(String(patient.age));
    setDisease(patient.disease);
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    const updatedData = { name, age: parseInt(age), disease };

    const res = await fetch(`http://localhost:8080/api/patients/${editingId}`, {
      method: 'PUT',
      headers: {
        'Content-Type': 'application/json',
        Authorization: `Bearer ${token}`,
      },
      body: JSON.stringify(updatedData),
    });

    if (res.ok) {
      const updatedPatient = await res.json();
      setPatients(patients.map((p) => (p.id === updatedPatient.id ? updatedPatient : p)));
      resetForm();
    } else {
      alert('Failed to update patient');
    }
  };

  const resetForm = () => {
    setEditingId(null);
    setName('');
    setAge('');
    setDisease('');
  };

  return (
    <div className="p-8 min-h-screen bg-gradient-to-br from-cyan-100 via-blue-50 to-purple-100">
      <h1 className="text-4xl font-bold text-center text-blue-700 mb-10 drop-shadow-lg">ðŸ©º Doctor Dashboard</h1>

      {editingId && (
        <form onSubmit={handleUpdate} className="max-w-2xl mx-auto bg-white rounded-xl shadow-lg p-6 mb-8">
          <h2 className="text-2xl font-semibold mb-4 text-indigo-700">Edit Patient Details</h2>
          <div className="space-y-4">
            <input
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
              placeholder="Patient Name"
              className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-400"
              required
            />
            <input
              type="number"
              value={age}
              onChange={(e) => setAge(e.target.value)}
              placeholder="Patient Age"
              className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-400"
              required
            />
            <input
              type="text"
              value={disease}
              onChange={(e) => setDisease(e.target.value)}
              placeholder="Disease (if any)"
              className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-400"
            />
            <div className="flex justify-end gap-4">
              <button
                type="submit"
                className="bg-green-500 hover:bg-green-600 text-white px-6 py-2 rounded-lg shadow-md transition"
              >
                Update
              </button>
              <button
                type="button"
                onClick={resetForm}
                className="bg-gray-400 hover:bg-gray-500 text-white px-6 py-2 rounded-lg shadow-md transition"
              >
                Cancel
              </button>
            </div>
          </div>
        </form>
      )}

      <div className="max-w-4xl mx-auto bg-white rounded-2xl shadow-xl p-6">
        <h2 className="text-2xl font-semibold text-indigo-600 mb-4">Patient Records</h2>
        <ul className="divide-y divide-gray-200">
          {patients.map((p) => (
            <li key={p.id} className="flex justify-between items-center py-4 hover:bg-gray-50 transition rounded-lg px-2">
              <div>
                <h3 className="text-lg font-medium text-gray-800">{p.name}</h3>
                <p className="text-sm text-gray-500">Age: {p.age} | Disease: {p.disease || 'N/A'}</p>
              </div>
              <button
                className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-1 rounded-md shadow transition"
                onClick={() => handleEdit(p)}
              >
                Edit
              </button>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}
